from app.models import db, Moment


def seed_moments():
    moment1 = Moment(
        description='This is a pretty day!', media='data:image/jpeg;base64,', userId=1)
    moment2 = Moment(
        description='Enjoy the moment!', media='data:image/jpeg;base64,', userId=1)
    moment3 = Moment(
        description='My Favorite flower~', media='data:image/jpeg;base64,', userId=2)
    moment4 = Moment(
        description='Amazing!', media='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTCfMwJPxkyrhUgY3jpf4HN6N1IRj6YRz8EYg&usqp=CAU', userId=3)
    moment5 = Moment(
        description='Fall is coming.', media='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSZH74P8OjUx0d6tEpOzIXPuI10p5YOv9skDA&usqp=CAU', userId=5)

    db.session.add(moment1)
    db.session.add(moment2)
    db.session.add(moment3)
    db.session.add(moment4)
    db.session.add(moment5)

    db.session.commit()


# Uses a raw SQL query to TRUNCATE the moments table.
# SQLAlchemy doesn't have a built in function to do this
# TRUNCATE Removes all the data from the table, and RESET IDENTITY
# resets the auto incrementing primary key, CASCADE deletes any
# dependent entities
def undo_moments():
    db.session.execute('TRUNCATE moments RESTART IDENTITY CASCADE;')
    db.session.commit()
